import React, {Component} from 'react';
import students from '../mock-data/students.json';

class Grid extends Component {

    render() {
        return (
            <div className = 'Grid'>
                <div>
                    {students.map((studentItem)=>{
                        return <p>{studentItem[0]}</p>
                    })}
                </div>
            </div>
        )
            }
}
export default Grid;
